【おそとでメディキュット 着圧ストッキング スレンダーマジック ナチュラルブラウン L-LLの詳細】<br>●着圧の黄金比率が脚から下半身全体をしっかり引き締め。<br>●目が行きがちなふくらはぎをパワーサポートでほっそり見せる。<br>●気になる太もも部分もしっかり引き締め。<br><br>【使用方法】<br>1.製品を片方の脚に両手でたぐりよせ、つま先、かかとの順にはきます。<br>2.ひざまでゆっくり引っぱります。その後、もう片方の脚もひざまで引き上げます。<br>3.ひざから太もも、股部へと十分引っぱりながら交互に引き上げます。<br>4.ヒップラインを合わせて腰まで引き上げ着用します。<br><br>【ご注意】<br>○重度の血行障害がある方は使用しないでください。<br>○次の方は着用前に医師にご相談ください。<br>糖尿病、深部製脈血栓症、血行障害、うつ血栓心不全、炎症性疾患、装着部位の神経障害などで治療を受けている方<br>○着用にあたり、次のことを注意してください。<br>1.サイズが合わないものや2枚重ねての着用はしないでください。<br>2.使用中にしわやたるみができないようにしてください。<br>3.ひざ下、ひざ裏で生地が丸まらないように伸ばしてください。<br>4.就寝時の着用はしないでください。<br>○気分が悪くなったり、痛みやしびれなどの不快感、かゆみ、発疹等異常を感じたばあいは直ちに使用を中止してください。<br>○着用時間に制限はありません(就寝時は除く)。<br>○製品の変形を防ぐために、ねじれた状態でのご使用や保管をしないでください。<br>妊婦の方は使用しないでください。<br><br>【素材】<br>ナイロン、ボリウレタン<br><br>【内容量】<br>1足<br><br>【原産国】<br>日本<br><br>【販売元・製造元・輸入者名】<br>レキットベンキーザー・ジャパン<br>東京都品川区東五反田3-20-14 住友不動産高輪パークタワー15階<br>0120-634-434<br><br>［着圧ストッキング］<br><br><br><hr>広告文責：株式会社モリキ<br>電話：0269-38-0611<br><style type="text/css">
